import React, {useState} from 'react';
import { useNavigate } from 'react-router-dom';
import "./css/register.css"

const initialstate = {
   prenom: "", 
   nom: "", 
   email: "",
   password: ""
}

function Register() {
  const [formData, setFormData ] = useState(initialstate)

  const handleSubmit = (e) => {
      e.preventDefault()

  }

  const handleChange = (e) => {
    setFormData({...formData, [e.target.name]: e.target.value})
  }
  return (
    <div className='login'>
    <div className='login-container'>  
        <form className='login-form' onSubmit={handleSubmit}>
            <h1 className='login-title'>Connexion</h1>
           <label className='login-label'>email</label>
           <input className='login-input' placeholder='entez votre email' 
           type="email" onChange={handleChange} />
           <label className="login-label">Mot de Passe</label>
           <input className='login-input' placeholder='entre votre mot de passe'
            type="password" handleChange={handleChange}/>
           <button className='login-btn' type="submit">Se connecter</button> 
           <div className='login-footer'>
            <div className='login-footer-text'>
              <p>Vous n'avez pas de compte : <i>clicker ici</i></p>
            </div>
            <div className='login-footer-subtext'>
              <p>mot de passe oublier</p>
            </div>
           </div>
        </form>
        </div> 
    </div>
  )
}

export default Register
